import React, { Component } from 'react';
import './App.css';

import Section from './components/Section';
import Home from './components/Home';
import ContactUs from './components/ContactUs';
import Form from './components/Form';

import Footer from './components/Footer';

import FrontBackground from './image/front.jpg';
import ContactBackground from './image/contact.jpg';
import FormBackground from './image/wood.jpg';

const HomeBGStyle = {

}

const RegBGStyle = {
  height: '100vh'
}
const SectionList = {
  home: {
    navStyle: {
      color: 'black'
    },
    backgroundStyle: {
      backgroundImage: `url(${FrontBackground})`,
      height: '100vh',
      backgroundPosition:'center',
      backgroundRepeat: 'no-repeat',
      backgroundSize: 'cover'
    },
    body: null
  },
  contact: {
    navStyle: {
      color: 'white'
    },
    backgroundStyle: {
      backgroundImage: `url(${ContactBackground})`,
      height: '100vh',
      backgroundPosition:'center',
      backgroundRepeat: 'no-repeat',
      backgroundSize: 'cover'
    },
    body: ContactUs
  },
  form: {
    navStyle: {
      color: 'white'
    },
    backgroundStyle: {
      backgroundImage: `url(${FormBackground})`,
      height: '100vh',
      backgroundPosition:'center',
      backgroundRepeat: 'no-repeat',
      backgroundSize: 'cover'
    },
    body: Form
  }
}

class App extends Component {
  state = {
    section: 'home'
  }
  render() {
    return (
      <div className="h-100">
        <Section navStyle={SectionList[this.state.section].navStyle} backgroundStyle={SectionList[this.state.section].backgroundStyle} body={SectionList[this.state.section].body}/>
      </div>


    );
  }
}

export default App;
